import React from 'react'
import Tooltips from '../../../Tooltips/Tooltips.jsx'
import{ CSSTransition } from 'react-transition-group'


export default class BinarySearchTreeTooltips extends Tooltips {
    getContent() {
        return (
            <>
                <div id="tooltips">
                    <div>Binary Search Tree Tooltips active</div>
                    <div>{this.state.operation} : {this.state.step}</div>

                    <CSSTransition
                        in={this.state.active}
                        timeout={this.state.timeout}
                        classNames={this.visibleClasses}
                        appear={true}
                        key={this.state.operation + this.state.step}>

                        <button className='tooltips-next' onClick={this.props.next}>Next</button>

                    </CSSTransition>

                </div>
            </>
        );
    }
}
